var pathsWithMaxScore = function (board) {
  const mod = 10 ** 9 + 7;
  const sums = new Array(board.length + 1).fill(0)
    .map(() => new Array(board[0].length + 1).fill(0));
  const counts = new Array(board.length + 1).fill(0)
    .map(() => new Array(board[0].length + 1).fill(0));

  counts[board.length - 1][board[0].length - 1] = 1;

  for (let i = board.length - 1; i >= 0; i -= 1) {
    for (let j = board[0].length - 1; j >= 0; j -= 1) {
      if (board[i][j] === 'X' || board[i][j] === 'S') continue;

      sums[i][j] = sums[i][j + 1];
      counts[i][j] = counts[i][j + 1];

      if (sums[i + 1][j + 1] > sums[i][j]) {
        sums[i][j] = sums[i + 1][j + 1];
        counts[i][j] = counts[i + 1][j + 1];
      } else if (sums[i + 1][j + 1] === sums[i][j]) {
        counts[i][j] = (counts[i][j] + counts[i + 1][j + 1]) % mod;
      }

      if (sums[i + 1][j] > sums[i][j]) {
        sums[i][j] = sums[i + 1][j];
        counts[i][j] = counts[i + 1][j];
      } else if (sums[i + 1][j] === sums[i][j]) {
        counts[i][j] = (counts[i][j] + counts[i + 1][j]) % mod;
      }

      if (counts[i][j] > 0) sums[i][j] += (+board[i][j] || 0)
    }
  }

  return [sums[0][0], counts[0][0]]
};

